import { createReducer } from 'redux-starter-kit';
import { ADD_LIFT, ADD_SET } from '../actions/types';

const initialState = {
  lifts: [
    {
      name: 'SQUAT',
      sets: []
    }
  ]
};

const currentWorkoutReducer = createReducer(initialState, {});

export default currentWorkoutReducer;
